import React from "react";

function Jumbotron() {
  return (
    <div
      style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
      className="jumbotron"
    >
      <h1>Google Book Search (React)</h1>
      <p>Search for and save books of interest!</p>
    </div>
  );
}

export default Jumbotron;
